import React, { Component } from 'react';
import ContactLink from './ContactLink'
import email from '../images/contacts/email-white.png';
import github from '../images/contacts/github-white.png';
import linkedin from '../images/contacts/linkedin-white.png';
import twitter from '../images/contacts/twitter-white.png';

class ContactPage extends Component {

  state = {
    links: [
      {
        image: email,
        alt: "Email icon",
        link: "kennethan12@gmail.com"
      },
      {
        image: github,
        alt: "GitHub icon",
        link: "https://github.com/kennethan12"
      },
      {
        image: linkedin,
        alt: "LinkedIn icon",
        link: "https://www.linkedin.com/in/kennethan12/"
      },
      {
        image: twitter,
        alt: "Twitter icon",
        link: "https://twitter.com/kennethan12"
      }
    ]
  }

  render() {
    const { links } = this.state;

    return (
      <div class="container-fluid" style={{ backgroundColor: "#2E3C47", flexWrap: "wrap" }}>
        <div class="container">
          <div class="row">
            <div class="col">
              <p className="h2" style={{ color: 'white' }}>Contact</p>
            </div>
          </div>
          <div class="row">
            <div className="underscore-white" />
          </div>
          <div class="row mt-4">
            {links.map((link) => {
              return (
                <ContactLink image={link.image} alt={link.alt} link={link.link} />
              )
            })}
          </div>
        </div>
      </div>
    )
  }
}

export default ContactPage;
